import React from "react";
import VideoPlayer from "./VideoPlayer";

const App = () => {
  const hlsUrl = "http://192.168.1.200:3000/output/output.m3u8";

  return (
    <div>
      <h1 className="text-center">My HLS Video Player</h1>
      <VideoPlayer url={hlsUrl} />
    </div>
  );
};

export default App;
